INSERT INTO survey_player VALUES (56, 1, 0.00, 56, 35, 1, 'f', 'f', NULL, '', 24, 'weiblich', 'In der Vorbereitungsphase habe ich keine weitere Entscheidung getroffen, als jene die bereits angegeben waren. Anschließend habe ich in jeder weiteren Durchführungsphase immer die Aufträge ausgewählt, welche in den nächsten 10 Tagen fällig waren. So bin ich auf Kosten für die Produktion und Lager auf 0.00€ gekommen. Diese Taktik habe ich für meine weiteren Durchführungsphasen immer so weiter beibehalten. 
