INSERT INTO survey_player VALUES (44, 12, 0.00, 44, 33, 1, 'f', 'f', NULL, '', 20, 'weiblich', 'Ich habe zunächst geschaut welche Aufträge in naher Zukunft erfüllt werden müssen, anschließend überlegt wie viele Aufträge ohne Kosten innerhalb dieser Zeit produziert werden können, in diesem Fall waren es 2. Dies hat bei allen Runden funktioniert, somit habe ich meine Logik während der Durchführungsphase nicht geändert.
INSERT INTO survey_player VALUES (47, 15, 0.00, 47, 33, 1, 'f', 'f', NULL, '', 25, 'weiblich', '1. Ich habe immer die zwei dringensten Auftäge freigegeben um so weder einen Aufschlag für Wartezeit noch für Verspätungen zahlen zu müssen. Auf Grund von Variation in der Produktionszeit habe ich diese Logik im Laufe der Durchführungsphase geändert. Ich habe mehr Aufträge freigegeben, weil dies günstiger ist als Verspätungen. 2. Die zentrale Information zur Freigabe war für mich die durchschittliche Produktionszeit in Kombination mit dem Lieferdatum. 3. Eine Überraschung war für mich der Übergang von Vorbereitungsphase zu Durchführungsphase. Dies sollte besser kenntlich gemacht werden. Irgendwann habe ich gesehen, dass ich bereits in der Durchführungsphase bin und war etwas überrascht. ', 'Universität/Fachhochschule', 'Fakultät für Volkswirtschaft und Statistik', 'Ja', 9, 5, 7, 3, 6, 2, 2, 6, 4, 7, 5, 3, 5, 6, 6, NULL, 'Die Produktionszeit hat variert. Ich habe mehr Aufträge freigegeben, weil dies günstiger ist als Verspätungen.', 1, 3, 3, 5, 5, 5, 7, 'f', 't', 't', 't', 't', 2, 33, 33);
